colors, lines, and messages should appear and be properly formatted

comments.body:
Here's my observations:

The coloring issues are handled by TISTUD-2698.

Using the new CLI with a very recent SDK build, I am not seeing proper output inside Studio _and_ on the command line, indicating it's a platform issue.

I have an app with a bunch of logging calls:
{code}
Ti.API.trace('line0\nline1\nline2\nline3');
Ti.API.trace(['Ti.API TRACE', 'ARG1', 'ARG2']);

Ti.API.debug('line0\nline1\nline2\nline3');
