Ti.API.warn(['Ti.API WARN', 'ARG1', 'ARG2']);

Ti.API.error('line0\nline1\nline2\nline3');
Ti.API.error(['Ti.API ERROR', 'ARG1', 'ARG2']);
{code}

Running it against CLI 3.0.16 and SDK 3.0.0.v20121112163159 on the command line as:
{code}
